INSERT INTO `v1_fca02eb70da10c7faf1d37f381bca807c6104a54734955eda84a546ebaa6f4f1` VALUES ("アサヒ", 1, 0, 1, 6000, "---", "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 3, 2, "");
INSERT INTO `v1_fca02eb70da10c7faf1d37f381bca807c6104a54734955eda84a546ebaa6f4f1` VALUES ("部員3", 1, 3, 3, 16000, "アドレナリン", "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 0, 3, "ホームランを連発すると、連発数に応じてパワーアップする");
INSERT INTO `v1_fca02eb70da10c7faf1d37f381bca807c6104a54734955eda84a546ebaa6f4f1` VALUES ("{0}", 1, 2, 2, 30000, "ラッキー", "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 2, 4, "幸運のハプニングを呼び込む");
